insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (1,1,' 征集登山意见','','','','<div class=\" \" style=\"font-family: Arial; \">各位同事：<br />&nbsp;<br />大家好！<br />&nbsp;<br />公司计划年会有登山活动项目，目前提供 <span style=\"color:#ff6666;\">凤凰岭和香山</span> 两个地址进行选择，现征集各位的意见， <span style=\"color:#ff6666;\">两者选其一</span>，请于明天上午11 点前将自己想去的那座山名字回复到此邮箱，我们将进行统计，谢谢合作。<br />&nbsp;<br />凤凰岭简介<br />国家AAAA 级旅游景点。位于 海淀区苏家坨镇 西山农场境内。距市中心30 公里。 八达岭高速公路 可直达景区。是京郊小西山风景区中新兴旅游景点和旅游胜地。清代《帝京景物略》记载： “ 山在昌平州西南二十五里 ，高十余丈. 自金章宗游此，携驻跸字，人乎驻跸山。” 金章宗沿西山建有八大水院，风景区 内黄普院便是其中之一。<br />风景区享有 “ 京西小黄山”之美誉，“奇峰” 、“ 怪石” 、“ 林海” 、“ 神泉” 为其天然景观。 “奇峰”：千姿百态，争奇斗异， 神女峰荡气回肠，雄狮峰龙蟠虎踞；“ 怪石”：怪石林立，形神兼备，如玉兔凌空，如石猴戏天，如情人窃语，姿态万千； “ 林海 ” ：古松 古柏古银杏，古木参天；桃林、 杏林 、苹果林，林园世界，既可观光游览，又可自助采摘； “ 神泉 ” ：元素丰富、绵甜爽口，泉中极品，闻名远近。风景区三季有花，四季有景：春有 “ 桃源杏海”、“怡桥春照” ；夏有 “ 银练碎玉”、“白瀑垂帘” ；秋有 “ 深秋红叶”、“金果飘香” ；冬有 “ 层峦睛雪”、“白玉倒悬” 。是春游踏青、夏令避暑、秋赏果熟、冬观雪景的胜地。<br />&nbsp;<br />详见 http://baike.baidu.com/view/74647.htm<br />&nbsp;<br />香山简介，<br />香山 (Fragrance Hill ) 又叫静宜园 ，位于北京 海淀区西郊，距市区 25公里，全园面积160 公顷， 最高峰 海拔 575 米，是北京著名的森林公园。1186 年，金代皇帝在这里修建了大永安寺，又称甘露寺。寺旁建行宫，经历代扩建，到乾隆十年（ 1745 ）定名为静宜园 。 1860 年和 1900 年惨遭抢劫和焚毁，1949 年后陆续修复了大部分名胜。主要景点有鬼见愁、玉华山庄、 双清别墅 等。<br />&nbsp;<br />详见 http://baike.baidu.com/view/9889.htm<br /></div>','','','',1,21,1,2,'2013-04-16 14:21:39','',1,'2013-03-14 00:00:00',2,'2013-04-16 14:21:19');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (2,1,'关于元旦放假通知','','','','<p>公司全体员工：</p>&nbsp;&nbsp;&nbsp;&nbsp; 大家好！<br />&nbsp;&nbsp;&nbsp;&nbsp; 接到集团通知根据公司整体安排，现将 2013 年元旦放假安排最后执行通知如下：<br />1月 1日(星期二，元旦 )至1月3日( 星期四) 放假调休，共3 天，2012年12月31日照常上班，2013年1月5日( 星期六 )、6日( 星期天)上班。<br />节假日期间，请大家提前妥善安排好工作，如需加班者，需提前报领导批准；根据工作需要，应保证通讯畅通；放假期间，一律禁止非申请加班者进入公司并使用电器及办公设备；如遇重大突发事件发生，要按规定及时报告并妥善处置，确保平安度过节日假期。<br />请大家于1月4 号准时返回公司上班。<br />&nbsp;<br />&nbsp;<br />&nbsp;<br />&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 人力资源部<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012 年12月27日<br />','','','',1,9,1,2,'2013-03-29 18:00:21','',1,'2013-03-14 00:00:00',2,'2013-03-14 14:52:02');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (3,1,'关于实行新销售提成制度的通知','','','','<div style=\"font-size: 13px; font-family: Arial; \"></div>各位同事：<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp;大家好！<br />&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp;经公司研究决定，原有的销售提成制度执行到8月31日止，从9月1日起将实行新的销售提成制度，详情请等待新的制度发文通知。<br />&nbsp; &nbsp; &nbsp; &nbsp;特此通知。<br />&nbsp;<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;人力资源部<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2012年8月30日<div style=\"font-size: 13px; font-family: Arial; \"></div>','','','',1,5,1,2,'2013-03-29 18:02:09','',2,'2013-03-14 00:00:00',2,'2013-03-14 14:51:45');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (4,1,'关于贵宾室预约登记的通知','','','','各位同事：<br />&nbsp; &nbsp; &nbsp;&nbsp;<br />&nbsp; &nbsp; &nbsp; 大家好！<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; 即日起,为避免使用贵宾室时间冲突, 如需使用贵宾室会谈重要客户请至少提前一天到人事行政部处进行预约登记.如果出现临时突发情况,请事先确认贵宾室在无人使用的情况下再进行使用.<br />&nbsp; &nbsp; &nbsp; 特此通知。请各位配合，谢谢。<br />&nbsp;<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;人力资源部<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2012年7月23日','','','',1,2,1,2,'2013-03-29 18:02:09','',2,'2013-03-14 00:00:00',2,'2013-03-14 14:51:42');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (5,1,'关于办理公积金联名卡的通知','','','','各位同事：<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; 大家好！<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; 人力资源部将统一组织办理公积金联名卡，请各位已经通过转正的同事，向人力资源部发送报名邮件，提交资料的内容如下：<br />&nbsp; &nbsp; &nbsp; 请各位按如上格式发送报名邮件，并同时提交身份证（正反面在同一面上且文字、号码均清晰）复印件一张，于本周四（6月7日）前交至人力资源部。<br />&nbsp; &nbsp; &nbsp; 各位暂未转正的同事请等待下一批次统一组织办理公积金联名卡。谢谢配合。<br />&nbsp; &nbsp; &nbsp; 注意：已经办理过公积金联名卡的同事就不要报名了，个人名下只能拥有一张公积金联名卡。<br />&nbsp;<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 人力资源部<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2012年6月5日','','','',1,1,1,2,'2013-03-29 18:05:46','',2,'2013-03-14 00:00:00',2,'2013-03-14 14:51:36');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (6,1,'关于六一儿童节放假事宜通知','','','','&nbsp;各位同事：<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; 大家好！<br /><br /><br />&nbsp; &nbsp; &nbsp; &nbsp; 明天是六一儿童节，为了给孩子们营造一个快乐的节日气氛，公司决定给已有孩子的同事放假半天（明天下午），请各位可以放假的同事提前安排好手头工作，享受假期。其他不符合此条件的同事请继续在工作岗位上奋斗。<br />&nbsp; &nbsp; &nbsp; &nbsp; 特此通知。<br />&nbsp;<br />&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 人力资源部<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2012年5月31日','','','',1,1,1,2,'2013-03-29 18:08:34','',2,'2013-03-14 14:10:36',2,'2013-03-14 14:10:36');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (7,2,'港资房企内地土地储备依然庞大 融资需求增大','','','071554oodbd7cyc8wmw9fw.jpg','<p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">新国五条的颁布，从资金风险层面向房企发出不能再疯狂拿地的信号。一位国际房产咨询顾问公司研究部人士分析，“港资房企过去十年在内地的<a href=\"http://land.k8.cn/\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">土地</span></a>储备，已经完成了囤地升值的使命，现在需加快开发消化以应对这一轮<a href=\"http://info.k8.cn/topic-ztyjhlks.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">调控</span></a>，而面对银根收紧，只有想法通过自身融资造血。港资<a href=\"http://info.k8.cn/topic-ztfqrz.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">房企融资</span></a>加快内地土储的消化，既是调控所迫，也是自身良性发展必需。”</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">知名房企销售普遍向好 港资房企亦不例外</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">2月27日，<a href=\"http://info.k8.cn/topic-pdxsj.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">新世界中国</span></a>公布截至去年底的中期业绩，期内物业销售溢利升18.6%，至15.97亿港元；实现签订合约物业销售额达84.76亿元人民币，增长101%。瑞房(00272.HK)今年首两个月，累计合约物业销售额达到25.24亿元，较上年同期大增4.3倍，平均售价为每平方米3.44万元。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">港资房企内地土地储备依然庞大</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">来自官网披露的数据显示：截至2012年6月底，瑞安房产在内地可供出租以及销售的建筑面积为1334.6万平方米；新世界中国计划于2013年财年下半年落成13 个项目，住宅总楼面面积为101.2万平方米；新鸿基地产截至2012年6月底，内地土储中待开发建筑建面744万平方米。其他如恒基地产、恒盛地产等均在2012年前揽下大量土储。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">由于去年所定销售目标保守，今年大部分港资房企对于销售目标均有20%的上调，这是加快土储消化的重要原因。如新世界发展今年计划推出8个新项目。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">推盘量增加意味着融资需求增大</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">新世界发展(00017.HK)今年已连续融资超过34亿元，包括今年2月初发行一笔30亿元人民币债券，2月底全资子公司获得4亿元的有期贷款融资。3月8日，新世界发展宣布考虑分拆若干酒店业务于联交所独立上市。据公开资料，新世界在香港、内地及东南亚拥有16家酒店，2013财年上半年收益18.74亿元。据高盛上月底的报告预测，至今年6月底，新世界现有的酒店估值133.74亿元。此前瑞安房地产也曾宣布计划分拆旗下<a href=\"http://info.k8.cn/topic-ztxzsydc.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">商业地产</span></a>上市。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">太古地产(01972)正在申请一项金额5亿美元息率2.75%于2020年到期的有担保票据，业内估计此举与一再延期动工的上海大中里综合体项目有关。上海大中里项目于去年底动工。</p>','','','',1,11,1,2,'2013-03-29 18:20:27','',2,'2013-03-14 14:14:44',2,'2013-03-14 14:14:44');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (8,2,'货币超发未现“堰塞湖”危险 房价需再控制','','',NULL,'<p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">3月13日，在央行就“货币<a href=\"http://info.k8.cn/policy\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">政策</span></a>与金融改革”召开的发布会上，全国政协副主席、中国人民银行行长周小川表示，今年的货币政策为中性，比去年紧，并强调保持物价稳定；同时专门针对房地产的一些价格调整措施还会继续使用，有的还会继续加大一定力度。他并回应质疑称，货币超发并未造成“堰塞湖”危险。　</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">今年货币政策将中性偏紧</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">继前天上午召开发布会后，央行再次将就“货币政策与金融改革”的相关问题回答中外记者提问。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">会上，全国政协副主席、中国人民银行行长周小川表示，今年将执行稳健的货币政策，“也就是中性，不再是宽松货币政策。”其表示，“M 2增速定为13%，该数字对比去年和前年，实际上趋于更紧一点，强调保持物价的基本稳定。”周小川称，2013年信贷会继续保持平稳增长。此外，他强调，打算通过货币政策等其他措施，希望能够稳定物价、稳定通货膨胀预期；同时专门针对房地产的一些价格调整措施还会继续使用，有的还会继续加大一定力度，从而实现控制<a href=\"http://info.k8.cn/topic-ztlps.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">房价</span></a>的目标。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">中央党校校委委员、经济学家赵长茂认为，今年的货币政策将适度从紧，既要保持经济发展向好势头，又要控通胀、减轻货币超发的压力。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">“货币超发造成通胀和资产泡沫，货币当局应当逐步消除货币超发带来的隐患，为此在货币政策的取向上需要注意。”赵长茂预计，当经济增长势头保持住以后，货币投放的增幅会适当下调；同时转变发展方式和经济结构调整，也需要适度从紧的货币环境，形成一种压力。因为如果货币还是很宽松，长线行业比如钢铁还是能获得很多货币供给，经济<a href=\"http://info.k8.cn/topic-ztyjhlks.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">调控</span></a>会有阻力。而一般来说，在货币政策从紧状态下才能加速淘汰。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">M2/G D P 188%　远超国际标准</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">对于货币超发或已成为“堰塞湖”、引发通胀的质疑，周小川回应说，M 2的总量跟堰塞湖不是一回事。“多年来对M 2的总体把握不错。中国储蓄率高、间接融资比例高，造成M 2高。但从国际来看，中国不是最高。且M 2高不一定就导致通胀。”</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">不过，赵长茂表示：“我国前几年经历了持续大量投放过程，到去年底M 2广义货币供应量余额达97.4万亿元，与去年G D P(51.9万亿)相比，比例达188%，创历史新高。美国近几年实行三轮了量化宽松，但其比例也不过是57%，比我们低得多。而从国际标准看，M 2占G D P比例的上限是100%。这说明前几年货币发行过多，货币超发严重。”</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">中银香港高级经济师黄少明则认为，前几年货币超发主要是由外汇占款和外汇管理体制造成的。而且虽然是超发，但实际上因为央行对各银行有超过20%的<a href=\"http://info.k8.cn/topic-ztyhckjl.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">存款准备金率</span></a>的要求，也就是97.4万亿广义货币当中近20亿元被收起来了，没有数据显示得那么严重。此外，央行还通过公开市场操作，使到期资金回笼。<br style=\"margin: 0px; padding: 0px; word-wrap: break-word; \" />　<br style=\"margin: 0px; padding: 0px; word-wrap: break-word; \" /><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">今年或进一步放宽利率浮动区间</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">就金融改革而言，中国人民银行副行长胡晓炼表示，在今后特别是在“十二五”规划的过程中，利率市场化的进程一定会继续向前。而在利率市场化之后，还需要相应的配套的制度性安排，要考虑存款保险制度的建立。“在目前的利率市场化过程中，我们的规划是对于批发性业务的利率市场化可能会推进得更快一些，可能会通过增加新的金融产品来使得利率更具灵活性。”</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">周小川亦表示，负利率迟早会消失，会转变为正的实际利率，这是货币政策不断努力要实现的一个区间。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">“利率是资金的价格，如果其价格形成机制一直是行政定价，那么利率对经济的调节作用会受影响。”赵长茂认为，利率市场化会进一步推进，并预计今年可能就会进一步放宽利率浮动区间。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">“肯定会加快。”黄少明分析这两年，利率市场化是金融的基础设施，要不间断的稳定的继续放开。</p>','','','',1,5,1,2,'2013-03-29 18:37:08','',2,'2013-03-14 14:15:00',2,'2013-03-29 18:29:31');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (9,2,'楼市迎新一轮涨价高峰 “国五条”细则能否保护刚需','','','','<p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">买一套可以安居的住房已成为目前中国不少普通家庭的头等大事。然而，日渐高涨的<a href=\"http://info.k8.cn/topic-ztlps.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">房价</span></a>和愈加严格的<a href=\"http://info.k8.cn/topic-ztyjhlks.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">调控</span></a><a href=\"http://info.k8.cn/policy\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">政策</span></a>却频频引发“恐慌性”购房，城乡<a href=\"http://info.k8.cn/topic-ztbzf.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">保障性住房</span></a>的供应数量和较高门槛，也让不少百姓望房兴叹。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">“国五条”细则能否保护“刚需”？</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">“国五条”实施细则出台以后，已有武汉、长沙等二级城市相继执行公积金政策调整，政策调整的总体方向是提高了公积金贷款的门槛、收紧了贷款的额度。而随着<a href=\"http://info.k8.cn/topic-ztcdzf.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">租房</span></a>高峰季节的到来，北京等大城市的租房价格可能受到“国五条”的影响波及，迎来新一轮涨价高峰。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">其实，对二手房交易缴纳20%个人所得税的规定已经存在将近20年，中间细节几经调整，很长一段时间实际上都按1%-3%缴纳个人所得税。而在住房长期的卖房市场交易中，应该由卖房者支付的个人所得税几乎都由买方承担。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">业内人士分析称，目前二手房市场上的确出现了一些恐慌，但预计可能的各地政策落地细则比如会有保护自住的条款。如果是最近面临过户的，当然应该加紧过户。但还未达成意向交易的也无需恐慌。“国五条”细则出台前，二手房成交高峰仍将持续，但成交价格短期内或将受到抑制，呈稳步下探走势。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">由于“国五条”在全国“两会”前夕颁布，住建部长姜伟新成为“两会”上媒体的重点“围堵”对象。姜伟新说，无论新“国五条”什么时候出台，都会伤及一部分人的利益。这个政策不可能让13亿人都满意，只能符合大多数人的利益，符合长远利益。他表示，对于普通购房者的利益保护，可以进一步研究，解决方式是在“十二五”期间继续推进保障性住房建设。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \"><a href=\"http://info.k8.cn/topic-ztbzfjs.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">保障房</span></a>宗旨是让中低收入者得到真正实惠</span></p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">住房问题也成为今年两会上的最热门话题之一，无论政府工作报告还是人大、政协的工作报告，都对住房问题给予了关注。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">2013年政府工作报告显示，五年来，中国新建各类保障性住房1800多万套，棚户区改造住房1200多万套。2012年底，城镇和农村人均住房面积32.9平方米、37.1平方米，分别比2007年增加2.8平方米和5.5平方米。预计2013年城镇保障性住房基本建成470万套、新开工630万套。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">但目前所建的保障房还很难满足巨大的住房需求缺口，而“房叔”、“房妹”等事件的曝光，让保障房分配的公平公开性遭到了质疑。要避免开豪车住经适房，做着生意还住廉租房的不公平现象，就要在分配流程上实行严格管控。而保障房分配如何才能真正让中低收入者得到实惠，也成为关注焦点。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">国务院总理温家宝在作政府工作报告时强调，要继续抓好保障性安居工程建设和管理，让老百姓住上放心房、满意房，继续推进农村危房改造。要建立可持续的保障性住房建设资金投入机制，严格区分保障性住房和改善性住房的界限，建立健全保障性住房公平分配和运营机制，真正使低收入住房困难户得到实惠。</p>','','','',1,1,1,2,'2013-03-29 18:18:57','',2,'2013-03-14 14:16:39',2,'2013-03-14 14:16:39');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (10,2,'多地新公积金政策出炉 房价上涨幅度或加快','','',NULL,'<p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">进入3月以来，已有武汉、长沙等二级城市相继开始执行公积金<a href=\"http://info.k8.cn/policy\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">政策</span></a>调整。克尔瑞发布报告称，<a href=\"http://info.k8.cn/topic-ztsylsrc.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">楼市</span></a>的持续回暖，使新一轮<a href=\"http://info.k8.cn/topic-ztyjhlks.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">调控</span></a>不期而至，只要大环境未变，<a href=\"http://info.k8.cn/topic-ztlps.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">房价</span></a>没有得到有效控制，类似于公积金贷款、限购、提高贷款利率等政策就不会停止。　</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">3月1日，武汉市住房公积金中心发布信息称，将从3月10日起对武汉市公积金贷款和提取政策作出调整。新规主要涉及在原公积金贷款额度计算方法基础上，增加职工住房公积金缴存时间及缴存账户余额等系数标准；分别对新参缴住房公积金的职工、已参缴住房公积金6个月及以上的职工以及异地调入武汉市的职工实施不同的公积金贷款额度审核方式。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">此外，规定购买首套住房且为一手房(含商品房、集资房、经济适用房)，套型建筑面积在90平方米(含)以下的，住房公积金贷款最高比例不得超过所购房屋总价的80%；套型建筑面积在90平方米以上的，贷款最高比例不得超过所购房屋总价的70%。购买二手房，所购房屋建成时间在10年 (含10年)、11年~20年、21年~30年以内的，贷款最高比例分别不超过房屋总价的70%、60%和50%。购买第二套住房且符合武汉市职工家庭现有住房建筑面积在140平方米及以下规定的，贷款最高比例不得超过房屋总价的40%。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">无独有偶，长沙市住房公积金管理委员会也在2013年2月8日发布了相关公积金调整政策。相关文件显示，长沙此次住房公积金提取和个人住房贷款政策变化主要表现在以下方面，即：职工申请使用住房公积金贷款，须正常缴存住房公积金12个月(含)以上，此前是6个月以上；职工购买、建造、翻建、大修同一套普通自住房已申请提取住房公积金的，不予发放住房公积金个人住房贷款；<a href=\"http://info.k8.cn/topic-ztyhstfd.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">首套房</span></a>面积超120平方米，买第二套房不得再申请住房公积金贷款；停止向购买第三套及以上住房的缴存职工发放住房公积金贷款；借款人的工资收入根据该职工住房公积金缴存基数推算确定 (月缴存额低于320元的按最低缴存比例5%测算)；职工住房公积金贷款期限，不得超过借款人办理贷款时至法定退休年龄的工作年限。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">长沙上述规定于2013年3月1日起执行，即“国五条”发布前一天。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">业内人士分析，提前调控加码，收紧公积金的城市，或因房价上涨幅度较快。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">据2013年2月中国房地产指数系统百城价格指数统计，武汉市新建住宅环比上涨0.74%，同比增长1.66%。而其主城区的二手住宅价格环比增长0.58%，同比增长8.83%。长沙市新建住宅的环比上涨幅度与武汉相同，增幅也为0.74%。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">根据克尔瑞发布的2013年2月的长春市场信息集成报告显示，长春市2月份商品住宅供求比为0.84，表明长春楼市买方热情高于卖方。随着商品住宅库存的逐渐减少，房企可推盘量的下降，以及购房者出现“按捺不住”的心态，因此，房价易出现上升的趋势。事实上，长春的成交均价为5965元/平方米，环比涨4%，同比涨8%。 克尔瑞发布报告称，类似公积金贷款、限购、提高贷款利率等楼市配套调控政策可能会继续。而各地的公积金贷款调整，在一定程度上，也是向外界表示响应中央控制房价的举措。另一方面看，公积金贷款的松紧也直接与当地公积金管理中心资金富余情况挂钩，近期楼市成交活跃，必然会出现公积金贷款申请量过大、供不应求的现象。不过，记者发现，此轮公积金政策调整虽然集中在3月份执行，但政策出台均在“国五条”之前。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">“房价短期再上涨的可能性不大。”北京中原地产市场研究总监张大伟表示，这次调控目前来看才是开端，虽然各地细则还未出台，但可以预测的是，起码对上半年房价会有明显的抑制作用。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">同策咨询研究中心总监<a href=\"http://info.k8.cn/topic-zlzhw.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">张宏伟</span></a>则认为，公积金政策个别城市提前收紧，多数是由于贷款额度不足，阶段性地进行调整，如果后期缴纳额度足够，还会进行相应调整。总体上公积金贷款支持刚需、自住需求的政策，并不会因为个别城市的暂时调整而发生变化。</p>','','','',1,2,1,2,'2013-03-29 18:37:08','',2,'2013-03-14 14:17:00',2,'2013-03-29 18:29:11');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (11,2,'SOHO中国未来1-2年可收预售款项达70亿','','3月11日，穆迪发布报告称，SOHO中国2012年财务业绩符合穆迪根据其Ba1评级作出的预期，其财务状况与流动性可继续支持其Ba1的公司家族评级和高级无抵押债券评级。',NULL,'<p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">3月11日，穆迪发布报告称，<a href=\"http://info.k8.cn/topic-pdsoho.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">SOHO中国</span></a>2012年财务业绩符合穆迪根据其Ba1评级作出的预期，其财务状况与流动性可继续支持其Ba1的公司家族评级和高级无抵押债券评级。2012年，SOHO中国营业额为153亿元，同比增169%，其毛利润增长2.3倍达90亿元，签约销售额为95亿元。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">穆迪副总裁、高级分析师曾启贤认为，“SOHO中国强劲的收入与利润使其EBITDA、利息覆盖率从2011年的4倍升至2012年的8.3倍。不过，随着SOHO中国的业务模式向着开发—自持转变，其房地产销售收入会逐渐下降，因此我们预计未来两年该公司的利息覆盖率将降至3-4倍。”</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">不过，SOHO中国的资产负债表较强，并有充裕的流动性和较低的净债务，从而可以平衡新业务模式的执行风险。</p><p style=\"margin: 20px 0px 0px; padding: 0px; word-wrap: break-word; font-size: 14px; line-height: 22px; text-indent: 28px; color: rgb(16, 54, 74); font-family: 宋体, Arail, verdana; background-color: rgb(246, 249, 253); \">截至2012年12月底，SOHO中国调整后的债务/资本比率为41%。其中包括了为项目开发先行融资的94亿元新债务及其96亿元的投资型<a href=\"http://info.k8.cn/topic-ztcgcx.html\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(0, 51, 102); text-decoration: none; \"><span style=\"margin: 0px; padding: 0px; word-wrap: break-word; \">房地产项目</span></a>的升值总额。与此同时，截至2012年12月，SOHO中国持有现金220亿元，未来1-2年可收到预售款项70亿元左右。</p>','','SOHO中国,曾启贤','',1,17,1,2,'2013-03-29 18:37:08','',2,'2013-03-14 14:17:00',2,'2013-03-29 18:25:06');
insert  into `article`(`id`,`channelId`,`title`,`subTitle`,`brief`,`smallPic`,`content`,`author`,`tag`,`source`,`status`,`viewCount`,`approveStatus`,`approveUserId`,`approveTime`,`approveNote`,`createUserId`,`createTime`,`modifyUserId`,`modifyTime`) values (12,2,'多家外资银行依然可享受首套房利率最低8.5折','','','','<p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 22px; BACKGROUND-COLOR: rgb(246,249,253); TEXT-INDENT: 28px; MARGIN: 20px 0px 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, Arail, verdana; WORD-WRAP: break-word; COLOR: rgb(16,54,74); FONT-SIZE: 14px; PADDING-TOP: 0px\">房地产<a style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; COLOR: rgb(0,51,102); TEXT-DECORATION: none; PADDING-TOP: 0px\" href=\"http://info.k8.cn/topic-ztyjhlks.html\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; PADDING-TOP: 0px\">调控</span></a>“新国五条”细则尚未出台，未来银行之间<a style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; COLOR: rgb(0,51,102); TEXT-DECORATION: none; PADDING-TOP: 0px\" href=\"http://info.k8.cn/topic-ztfdywjtb.html\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; PADDING-TOP: 0px\">房贷业务</span></a>差异化策略或正在形成。据了解，多家外资银行并未收紧房贷，目前恒生、汇丰、花旗、渣打等多家银行依然可做到<a style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; COLOR: rgb(0,51,102); TEXT-DECORATION: none; PADDING-TOP: 0px\" href=\"http://info.k8.cn/topic-ztyhstfd.html\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; PADDING-TOP: 0px\">首套房</span></a>利率最低8.5折首付三成、二套房利率上浮10%首付六成的优惠。</p><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 22px; BACKGROUND-COLOR: rgb(246,249,253); TEXT-INDENT: 28px; MARGIN: 20px 0px 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, Arail, verdana; WORD-WRAP: break-word; COLOR: rgb(16,54,74); FONT-SIZE: 14px; PADDING-TOP: 0px\">3月12日，恒生中国副董事长兼行长关燕萍表示，外资行的房贷业务空间不是很愁，业务机会并没有很大的挑战。<img src=\"../upload/2013/4/16/EFAF6325D82EC1681A014B47EE721ADE.jpg\" width=\"auto\" height=\"auto\" alt=\"\" /></p><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 22px; BACKGROUND-COLOR: rgb(246,249,253); TEXT-INDENT: 28px; MARGIN: 20px 0px 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, Arail, verdana; WORD-WRAP: break-word; COLOR: rgb(16,54,74); FONT-SIZE: 14px; PADDING-TOP: 0px\">事实上，外资行受制于网点数量较少，一般都没有条件“拼规模”，其房贷业务在市场上所占的比重很小。不过其不时推出的较优惠的房贷<a style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; COLOR: rgb(0,51,102); TEXT-DECORATION: none; PADDING-TOP: 0px\" href=\"http://info.k8.cn/policy\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; WORD-WRAP: break-word; PADDING-TOP: 0px\">政策</span></a>在市场上总能“赚足眼球”。业内人士认为，从营销的角度来讲，不拼“量”的增长，注重“质”的发展是外资行的发展策略。在中资银行业务收紧时对优质的客户推出优惠政策，更能够抓住市场机会。</p><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 22px; BACKGROUND-COLOR: rgb(246,249,253); TEXT-INDENT: 28px; MARGIN: 20px 0px 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, Arail, verdana; WORD-WRAP: break-word; COLOR: rgb(16,54,74); FONT-SIZE: 14px; PADDING-TOP: 0px\">值得注意的是，外资行客户基数一直较少，房贷业务可以带动其他资金、理财业务发展，是外资行拓展高端客户的一大窗口。此前花旗银行也表示未来将在内地加大房贷业务力度。花旗个人银行业务总裁周永赞称， “对花旗来说，房贷额度不是问题，目前资金非常充足，房贷业务依然在快速增长。”他还透露，花旗未来会在国内两个城市新加开房贷销售业务。</p>','','','',1,7,1,2,'2013-04-16 11:33:26','',2,'2013-03-14 14:21:00',2,'2013-04-16 11:33:06');
